function parseXML2JSON(xml){
	var x, y, xmlDoc, retStr;
	//xmlDoc = xml.responseXML;
	xmlDoc = jQuery.parseXML(xml);
	x = xmlDoc.getElementsByTagName("queryresult"); 
	y = xmlDoc.getElementsByTagName("community-calendars-result");

//need to code if either is null

	//console.log('[' + parseQuery(x) + ',' + parseConsCal(y) + ']');
	retStr =  '[' + parseConsCal(y) + ']';
	return retStr;
}
function parseConsCal(xml){
	var i, j, x, returnString;
	returnString = '';
	for(i=0; i<xml.length; i++){
		x = xml[i].getElementsByTagName("event");
			for(j=0; j<x.length; j++){
				returnString = returnString + '{"title":' + '"' + x[j].getElementsByTagName('title')[0].textContent + '",';
				returnString = returnString + '"startsAt":' + '"' + formatPSDateTime(x[j].getElementsByTagName('startdttm')[0].textContent) + '",';
				returnString = returnString + '"endsAt":' + '"' + formatPSDateTime(x[j].getElementsByTagName('enddttm')[0].textContent) + '"';
				if( x[j].getElementsByTagName('detail')[0] != null){
					returnString = returnString + ',"detail":' + '"' + x[j].getElementsByTagName('detail')[0].textContent + '"}';
				} else {
					returnString = returnString + '}'
				}
				if(j!=x.length-1){
					returnString = returnString + ','
				}
			}
		if(i!=xml.length-1) returnString = returnString + ','
	}
	return returnString;
}
function formatPSDateTime(psdatetime){
	str = psdatetime.replace(".",":").replace(".",":").substr(0,23);
	return str.substring(0,10) + "T" + str.substring(11,str.length);
}
function parseQuery(xml){
	var x, y, i, j, k, m, fieldNames, fieldNameValues, return_string;

	return_string = '';	
	for (m=0; m < xml.length; m++) {

		x = xml[m].getElementsByTagName("queryfields");
		x = x[0].getElementsByTagName("field");

		fieldNames = [];
		fieldNameValues = [];
		for (i=0; i < x.length; i++) {
			fieldNames.push(x[i].getAttribute("fieldname"));
			fieldNameValues.push(x[i].getElementsByTagName("headingtext")[0].textContent);
		}

		x = xml[0].getElementsByTagName("queryrows");
		x = x[0].getElementsByTagName("row");

		for (i=0; i < x.length; i++) {	
			y = x[i].getElementsByTagName("querydata")
			for (j=0; j < y.length; j++) {
				if(j==0) return_string = return_string + '{';
				for (k=0; k < fieldNames.length; k++) {
					if (fieldNames[k] == y[j].getAttribute("fieldname"))
						return_string = return_string + '"' + fieldNameValues[k] + '":"' + y[j].getElementsByTagName("text")[0].textContent + '"';
				}
				if(j==y.length-1) {
						if(m==xml.length-1 && i==x.length-1){
							return_string = return_string + '}';
						}else{
							return_string = return_string + '},';
						}
				} else {
					return_string = return_string + ',';
				}
			}
		}
	}
	return return_string;
}
